import React from 'react';
import './App.css';

function App() {

  const sayHello = ()=> {console.log('Hello');}
  return (
    <div className="App">
      <h1 className="App-h1">
        Sorting Algorithms Visualizer
      </h1>
      <button onClick={sayHello}>
        I am a button
      </button>
    </div>
  );
}

export default App;
